"use strict";
var NoModuleTester = (function () {
    function NoModuleTester() {
    }
    NoModuleTester.prototype.getBuffer = function () {
        return new Buffer("hello");
    };
    return NoModuleTester;
}());
describe("NoModuleTester", function () {
    it("should use no modules", function () {
        expect(new NoModuleTester().getBuffer()).toEqual(new Buffer("hello"));
    });
});
